import React, { useState } from "react";

import "./App.css";

import AlbumEntry from "./Components/Album Entry/AlbumEntry";

class App extends React.Component {
  constructor() {
    super();

    this.state = {
      data: [
        {
          imageSrc:
            "data:image/jpeg;base64,",
          votes: 47,
          albumName: "Algorythm",
          date: "Beyond Creation, 2018",
          submittedSrc: "Andrew",
        },
        {
          imageSrc:
            "data:image/jpeg;base64,",
          votes: 36,
          albumName: "Relentless Mutation",
          date: "Archspire, 2017",
          submittedSrc: "Tan",
        },
        {
          imageSrc:
            "data:image/jpeg;base64,",
          votes: 35,
          albumName: "Under the Red Cloud",
          date: "Amorphis, 2015",
          submittedSrc: "Jen",
        },
        {
          imageSrc:
            "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRsyInVtpTFGB10fh_pDjgWpcibLtye98DDnw&usqp=CAU",
          votes: 17,
          albumName: "Twilight of the Thunder God",
          date: "Amon Amarth, 2008",
          submittedSrc: "Tan",
        },
      ],

      albName: "",
      bandname: "",
      releaseyear: "",
      albumurl: "",
      submitter: "",

      submitters: ["Andrew", "Tan", "Dan"],
      submittersOb: {
        Andrew:
          "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR6wqZZPqK5ekD3oVZ1Z77x3aVEEdVvCtx3Kw&usqp=CAU",
        Tan:
          "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRbjDhqWwabMzvKeAfhsZT9e6UJKLXNSathHw&usqp=CAU",
        Jen:
          "data:image/jpeg;base64,",
      },
      counter: 0,
    };

    this.addData = this.addData.bind(this);
    this.setData = this.setData.bind(this);
    this.handleAlbName = this.handleAlbName.bind(this);
    this.handleBandName = this.handleBandName.bind(this);
    this.handleDate = this.handleDate.bind(this);
    this.handleAlbURL = this.handleAlbURL.bind(this);
    this.handleSubmitter = this.handleSubmitter.bind(this);
    this.increment = this.increment.bind(this);
    this.remove = this.remove.bind(this);
  }

  addData = (newEntry) => {
    this.state.data.push(newEntry);

    if (this.state.counter > 2) this.state.counter = 0;

    this.forceUpdate();
  };

  setData = (temp) => {
    this.state.data = temp;
  };

  handleAlbName = (e) => {
    this.state.albName = e.target.value;
  };
  handleBandName = (e) => {
    this.state.bandname = e.target.value;
  };
  handleDate = (e) => {
    this.state.releaseyear = e.target.value;
  };
  handleAlbURL = (e) => {
    this.state.albumurl = e.target.value;
  };
  handleSubmitter = (e) => {
    this.state.submitter = e.target.value;
  };

  increment = (AlbumName) => {
    var [found] = this.state.data.filter(
      (dict) => dict.albumName === AlbumName
    );

    found.votes = found.votes + 1;

    this.state.data
      .sort(function (a, b) {
        return a.votes - b.votes;
      })
      .reverse();

    this.forceUpdate();
  };

  remove = (AlbumName) => {
    this.setData(this.state.data.filter((dict) => dict.albumName != AlbumName));

    this.forceUpdate();
  };

  render() {
    return (
      <div className="App">
        <h2 style={{ marginBottom: "0px" }}>Popular Metal Albums</h2>
        <hr style={{ width: "90%", border: "1px solid lightgray" }} />

        {this.state.data.map((element) => {
          return (
            <AlbumEntry
              imageSrc={element.imageSrc}
              votes={element.votes}
              albumName={element.albumName}
              albumURL={element.albumURL}
              date={element.date}
              submittedSrc={this.state.submittersOb[element.submittedSrc]}
              updateVotes={[this.increment, this.remove]}
            />
          );
        })}

        <br />

        <form
          onSubmit={(e) => {
            e.preventDefault();

            this.addData({
              imageSrc:
                this.state.albumurl == ""
                  ? "http://s3.amazonaws.com/production.mediajoint.prx.org/public/piece_images/571466/The_Unknown_small.jpg"
                  : this.state.albumurl,
              votes: 1,
              albumName: this.state.albName,
              date: this.state.releaseyear,
              submittedSrc: this.state.submitter,
            });
          }}
        >
          <p>Add New</p>
          <input
            placeholder="Album Name"
            name="albumName"
            onChange={this.handleAlbName}
            required
          ></input>
          <input
            placeholder="Band Name"
            name="setbandname"
            onChange={this.handleBandName}
            required
          ></input>
          <input
            placeholder="Release Year"
            name="setreleaseyear"
            onChange={this.handleDate}
            required
          ></input>
          <input
            placeholder="Album Cover URL"
            name="setalbumurl"
            onChange={this.handleAlbURL}
          ></input>
          <input placeholder="More info URL"></input>

          <select onChange={this.handleSubmitter}>
            <option>Submitted by</option>
            <option>Andrew</option>
            <option>Tan</option>
            <option>Jen</option>
          </select>

          <input type="submit" id="submitButton" />
        </form>
      </div>
    );
  }
}

export default App;
